def create_features(w3, address, BACKTEST_VALUE, BACKTEST_MODE, backtest_block=None, last_trades=None, save_dict=False, verbose=False, is_LastTrades=False):

    if verbose:
        print(f"starting create_features() address={address} {BACKTEST_VALUE}{BACKTEST_MODE}")

    # if not is_LastTrades and BACKTEST_VALUE > 30:
    #     exit(f"Нельзя BACKTEST_VALUE > 30, иначе roi_by_blocks не подсчитается")

    if w3 == None:
        w3 = Web3(Web3.HTTPProvider(f"http://127.0.0.1:8545/?{''.join(random.choices(string.ascii_letters + string.digits, k=20))}"))
        if not w3.is_connected():
            raise Exception("w3 not connected")

    if not last_trades:
        start_time = time.time()
        with open(f"{DIR_LOAD_OBJECTS}/{to_checksum_address(address)}.pkl", 'rb') as o:
            last_trades = pickle.load(o)
        if verbose:
            print(f"object {address} loaded in {(time.time() - start_time):.2f}s")
    
    try:
        not_scam_tokens_detailed
    except NameError:
        not_scam_tokens_detailed = {}

    first_trade_block = last_trades.first_trade_tx_sql['block_number']
    # print('first_trade_block:', first_trade_block)
    # exit()

    _token_blocks = list(last_trades.blocks_data.keys())

    if BACKTEST_MODE == 'm':
        if backtest_block == None:
            backtest_block = first_trade_block + BACKTEST_VALUE * 60 // 12 - 1 # BACKTEST_VALUE min

            
    elif BACKTEST_MODE == 't':
        if backtest_block == None:
            for _block, block_data in last_trades.blocks_data.items():
                if block_data['total_trades_buy'] + block_data['total_trades_sell'] >= BACKTEST_VALUE:
                    backtest_block = _block
                    break

            if backtest_block == None:
                return {'error': f"backtest_block=None, sufficient total_trades for {BACKTEST_VALUE}{BACKTEST_MODE}, last total_trades={last_trades.blocks_data[_token_blocks[-1]]['total_trades_buy']+last_trades.blocks_data[_token_blocks[-1]]['total_trades_sell']}"}


    for i in range(backtest_block):
        if backtest_block - i in _token_blocks:
            backtest_block -= i
            break

    all_trades_blocks = []
    for b in _token_blocks:
        if b >= first_trade_block and b <= backtest_block:
            all_trades_blocks.append(b)
        if b > backtest_block:
            break

    if verbose:
        print(f"first_trade_block={first_trade_block} {datetime.fromtimestamp(last_trades.blocks_data[first_trade_block]['timestamp'])}, backtest_block={backtest_block} {datetime.fromtimestamp(last_trades.blocks_data[backtest_block]['timestamp'])}, all_trades_blocks len={len(all_trades_blocks)} {all_trades_blocks[0]}..{all_trades_blocks[-1]}")

    #if len(all_trades_blocks) < min(25, BACKTEST_VALUE * 60 // 12):
    if len(all_trades_blocks) < 5:
        # print(f"len(all_trades_blocks)={len(all_trades_blocks)} < min(25, BACKTEST_VALUE * 60 // 12)={min(25, BACKTEST_VALUE * 60 // 12)} for address={address} => return")
        if verbose:
            print(f"len(all_trades_blocks)={len(all_trades_blocks)} < 5 for address={address} => return")
