def target_func_max_price(row):
    value = not_scam_tokens_detailed[row['token_address']][f'max_price_change_after_{BACKTEST_VALUE}_{BACKTEST_MODE}']
    assert not np.isnan(value) and value != None
    if value < 3:
        return 'm_p_0_3'
    elif 3 <= value < 50:
        return 'm_p_3_50'
    elif 50 <= value < 100:
        return 'm_p_50_100'
    elif 100 <= value < 250:
        return 'm_p_100_250'
    elif 250 <= value < 500:
        return 'm_p_250_500'
    elif 500 <= value < 1200:
        return 'm_p_500_1200'
    elif value >= 1200:
        return 'm_p_1200+'

def target_func_rows(row):
    value = not_scam_tokens_detailed[row['token_address']]['rows']
    assert not np.isnan(value) and value != None
    if value < 500:
        return 'rows_0_500'
    elif 500 <= value < 1000:
        return 'rows_500_1k'
    elif 1000 <= value < 2000:
        return 'rows_1k_2k'
    elif 2000 <= value < 3000:
        return 'rows_2k_3k'
    elif 3000 <= value < 5000:
        return 'rows_3k_5k'
    elif 5000 <= value < 10000:
        return 'rows_5k_10k'
    elif 10000 <= value < 30000:
        return 'rows_10k_30k'
    elif value >= 30000:
        return 'rows_30k+'

